import React from 'react';
import '../styles/Hockey.css';


const Rugby = () => {
  return (
    <div className="hockey-container">
        <h1>RUGBY</h1>
      <h2>Welcome to Rugby at Kilifi Sports Hub!</h2>
      <p>Rugby is a cornerstone sport at Kilifi Sports Hub, with dedicated teams training and competing in local and regional leagues. The hub provides state-of-the-art facilities for rugby practice and matches, attracting players of all ages and skill levels.</p>
      <p>Teams at Kilifi Sports Hub regularly participate in tournaments and friendly matches, showcasing their talent and passion for the game. Experienced coaches mentor players, focusing on skill development, teamwork, and sportsmanship, shaping them into well-rounded athletes both on and off the field.</p>
    </div>
  );
}

export default Rugby;
